const TodoListEntry = (props) => (
    <Fragment>
        <input type="text" readOnly className="todo-entry-text" value={props.todo}
        onContextMenu={props.contextMenuHandler}/>
        <input type="button" className=""/>
        <input type="button" className="glyphicon-remove"/>
    </Fragment>
)

export default TodoListEntry;
